import React from "react";
import { MdApps, MdHome, MdPeople, MdNotifications, MdAccountCircle, MdSettings, MdPowerSettingsNew } from "react-icons/md";

import './Sidenav.css'
import {Link} from "react-router-dom";



export default function Sidenav(){
    return (
        <div className="sidenav--wrapper my-primary-color">
            <ul className="sidenav--header">
                <li className="sidenav-nav-link"><Link to="/root"><MdHome/></Link></li>
                <li className="sidenav-nav-link"><Link to="/"><MdApps/></Link></li>
                <li className="sidenav-nav-link"><Link to="/"><MdPeople/></Link></li>
                <li className="sidenav-nav-link"><Link to="/"><MdNotifications/></Link></li>
            </ul>
            <div className="sidenav--footer">
                <div className="sidenav-nav-link"><Link to="/"><MdAccountCircle/></Link></div>
                <div className="sidenav-nav-link"><Link to="/"><MdSettings/></Link></div>
                <div className="sidenav-nav-link"><Link to="/logout"><MdPowerSettingsNew/></Link></div>
            </div>
        </div>
    )
}
